class Solution:
    def uniqueLetterString(self, s: str) -> int:
        cnt = [-1]*26
        res = [[-1, len(s)] for j in range(len(s))]
        for i, c in enumerate(s):
            letter = ord(c) - ord('A')
            if cnt[letter] == -1:
                res[i][0] = -1
            else:
                res[cnt[letter]][1] = i
                res[i][0] = cnt[letter]
            cnt[letter] = i
        print(cnt)
        print(res)
        return sum((i-res[i][0]) * (res[i][1] - i) for i in range(len(res)))


